import React from 'react';
import { AppBar, Avatar, Button, Toolbar, Typography } from '@material-ui/core';
import useStyles from './styles';
import appBarImg from '../../images/appbarlogo.jpg';
import { Link } from 'react-router-dom';


const Navbar = () => {
    const classes = useStyles();
    const user = null;

    return (
        <AppBar className={classes.appBar} position="static" color="inherit">
            <div className={classes.brandContainer}>
                <Typography component={Link} to="/" className={classes.heading} variant="h2" align="center">Social Media App</Typography>
                <img src={appBarImg} className={classes.image} alt="appBarImg" height="60" />
            </div>
            <Toolbar className={classes.toolbar}>
                {user ? (
                    <div className={classes.profile}>
                        <Avatar className={classes.purple} alt={user.result.name} src={user.result.imageUrl}>{user.result.name.charAt(0)}</Avatar>
                        <Typography className={classes.userName} variant="h6">{user.result.name}</Typography>
                        <Button variant="contained" className={classes.logout} color="secondary"></Button>
                    </div>
                ) : (
                    <Button component={Link} to="/auth" variant="contained" color="primary"></Button>
                ) }
            </Toolbar>
        </AppBar>
    );
}

export default Navbar;
